import React, { useState } from "react";
import { Button, Card, CardContent, Grid, TextField } from "@mui/material";
import { Link } from "react-router-dom";

export const Form = () => {
  const [name, setName] = useState("");
  const [pass, setPass] = useState("");
  return (
    <Grid container spacing={2}>
      <Grid item xs={4}></Grid>

      <Grid item xs={4}>
        <Card>
          <CardContent>
            <h3>Sign In </h3>
            <p
              style={{ position: "relative", left: "-135px", fontWeight: 600 }}
            >
              Your E-mail
            </p>
            <TextField
              onChange={(e) => setName(e.target.value)}
              variant="outlined"
              fullWidth
              label="Email@example.com"
            />
            <p style={{ position: "relative", left: "-80px", fontWeight: 600 }}>
              Password{" "}
              <span
                style={{
                  position: "relative",
                  left: "160px",
                  color: "lightblue",
                }}
              >
                Forget Password?
              </span>
            </p>
            <TextField
              //   style={{ position: "relative", top: "80" }}
              variant="outlined"
              fullWidth
              label="Password"
            />
            <br /> <br />
            <Link to="cat">
              <Button variant="contained" color="success" fullWidth>
                Submit
              </Button>
            </Link>
          </CardContent>
        </Card>
      </Grid>
      <Grid item xs={4}></Grid>
    </Grid>
  );
};
